import React, {useContext} from 'react'
import { useNavigate } from 'react-router'
import mainContext from '../context/mainContext'

const Toolbar = () => {

  const {socket, getData, setData} = useContext(mainContext) 

  async function uploadreservation(){
    await socket.on("reservations", (data) => {
            setData(data)
            console.log(data)

        })

    nav("/reservation")
  }

    const nav = useNavigate()
  return (
    <div className="toolbar">

        <button onClick={() => nav("/messages")}>Messages</button>
        <button onClick={uploadreservation}>Make appointment</button>
    </div>
  )
}

export default Toolbar
